import { Navigate, Outlet } from "react-router-dom";

type MyProps = {
  users: boolean;
};

export const ProtectedRoutes = ({ users }: MyProps): JSX.Element => {
  /* PROTECTED ROUTES */
  if (!users) {
    return <Navigate to={"/"} />;
  }
  return <Outlet />;
};
